I’m actually loving the coziness of these chilly days indoors with twinkling lights and video games and lots of baking and cuddles. But gosh I do miss seeing green leaves and sunshine outside our windows 🥲 Also I adore this picture. It’s not everyday they love a meal so much they lick the plate 😂 Actually it’s been quite the opposite lately. We’re still trying to figure out an appropriate approach to food - an approach that allows them to listen to their bodies and have control over what they eat, that will, Lord willing, lead to a healthy relationship with food. But also what do you do when all they will eat is snacks and cookies? 😅 

Anyway, random thoughts of the day.

@doxa.photography

Note - this is just ONE way I help guide them to independent play. I’ll place these toys around the house as an open invitation for them to explore and play on their own!

@lovevery play kits are filled with toys that will keep your kiddos engaged and learning while developing those fine motor skills! We especially love pulling out these toys during school hours for the younger boys to play with while my oldest does her school work!

